    height: 200px;
    width: 50px;
    transform: none;
    border: solid 1px red;
}

.mob-menu {
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    height: 60vh;
    width: 100vw;
    background-color: $secondaryCol;
    transition: 1s ease-in-out;
    border-radius: 20px;
    display: none;
    z-index: 1;
    opacity: 0;

    .x {
        position: absolute;
        top: 2%;
        left: 4%;
        height: 22px;
    }

    ul {
        display: flex;
        flex-direction: column;
        justify-content: space-around;
        text-align: center;
        height: 60%;
        margin: auto 0;
        
        li {
            padding: 0;
            font-size: 4rem;
            cursor: pointer;

            a {
                color: white;
                font-weight: $bold;
            }
        } 
    }
}

body .active {
    @include grid-center;
    opacity: 1;
}

